	/*
	 * Opaque behavior for the class CommunicationReferee.
	 * Of transition "" from "Connected" to "CheckStatus".
	 */
	static void c_function_ChallengeEnv_opaqueBehavior_a150(CommunicationReferee_Object * this, checkReferee_signal_parameters * params) {
		
									char str[128] = {0};
		SET(this, status, UML_TcpConnectionRead(1, str, 127));
		if(GET(this, status)) {
										char * pch = strtok (str,";\n");
		bool possession = FALSE;
		bool timeout = FALSE;
		bool scored = FALSE;
		while (pch != NULL) {
											if(strcmp(pch, "Possesion") == 0) {
												possession = TRUE;
		} else if(strcmp(pch, "TimeOut") == 0) {
												timeout = TRUE;
		} else if(strcmp(pch, "scored") == 0) {
												scored = TRUE;
		} else if(strcmp(pch, "Done") == 0) {
												SEND(GET(this, trajectoryManager), abort);
		SEND(GET(this, controller), done);
		} else if(strcmp(pch, "player2") == 0) {
												if(possession) {
													possession = FALSE;
		SEND(GET(this, trajectoryManager), possession);
		} else if(timeout) {
													timeout = FALSE;
		SEND(GET(this, trajectoryManager), abort);
		SEND(GET(this, controller), timeout);
		}
											} else if(strcmp(pch, "player1") == 0) {
												if(scored) {
													scored = FALSE;
		SEND(GET(this, trajectoryManager), abort);
		SEND(GET(this, controller), opponentScored);
		}
											} else {
												possession = FALSE;
		scored = FALSE;
		timeout = FALSE;
		}
											pch = strtok (NULL,";\n");
		}
									}
									SEND(GET(this, trajectoryManager), refereeAck);
	}
